import React, { useState, useEffect } from 'react';
import 'ol/ol.css'; // OpenLayers styles
import { Map as AllMap, View } from 'ol'; // Map and View from OpenLayers
import { fromLonLat, get as getProjection } from 'ol/proj'; // Projection functions from OpenLayers
import { Tile as TileLayer } from 'ol/layer'; // TileLayer from OpenLayers
import { OSM } from 'ol/source'; // OpenStreetMap source from OpenLayers

function Map() {
    const [mapObject, setMapObject] = useState({});

    useEffect(() => {
        const map = new AllMap({
            layers: [
                new TileLayer({
                    source: new OSM()
                })
            ],
            target: 'map',
            view: new View({
                projection: getProjection('EPSG:3857'),
                center: fromLonLat([126.752, 37.4713], 'EPSG:3857'),
                zoom: 13
            })
        });

        setMapObject({ map });

        // Clean up function
        return () => {
            if (map) {
                map.setTarget(null);
            }
        };
    }, []); // Empty dependency array for componentDidMount behavior

    return <div id="map" style={{ height: '50rem' }}></div>;
}

export default Map;
